webpackJsonp([0x6848773676d8],{6446:function(e,t){e.exports={data:{post:{html:'<p>The DNS at my <a href="http://www.united-domains.de/">domain provider</a> has gone down, so you may have trouble reading this blog for a while. In fact, if you are reading this post, either the problem has gone away, or your browser hasn\'t noticed it yet. My IP is <a href="http://213.73.82.31">213.73.82.31</a>, but I don\'t expect anyone to remember that. The whole point of DNS is that we don\'t have to memorize IPs. Except, of course, when DNS is broken. Like now. </p>\n<p><b>Update</b> The problem lasted only a couple of hours. Things are better now.</p>',fields:{title:"Nameless",date:"19 Oct 2003",url:"https://papascott.de/2003-10-19-nameless/"}}},pathContext:{slug:"/2003-10-19-nameless/",prev:{fields:{title:"The British obessesion with Hitler...",date:"18 Oct 2003",slug:"/2003-10-18-the-british-obessesion-with-hitler/"}},next:{fields:{title:"Red Sox Haiku",date:"19 Oct 2003",slug:"/2003-10-19-red-sox-haiku/"}}}}}});
